import React from 'react';
import PropTypes from "prop-types";
import Radio from "@material-ui/core/Radio";
import RadioGroup from '@material-ui/core/RadioGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import FormControl from '@material-ui/core/FormControl';

const styleCustom = {
    radioGroup: { flexDirection: "row" },
    radio: { color: '#000000' },
    divWrapper: { marginBottom: '24px' }
}

function RadioDebitCredit({ input, ...rest }) {
    return (
        <div style={styleCustom.divWrapper}>
            <FormControl>
                <RadioGroup
                    {...input} {...rest}
                    style={styleCustom.radioGroup}
                // onChange={this.handleChange}
                >
                    <FormControlLabel
                        value="debit"
                        control={<Radio style={styleCustom.radio} />}
                        label="Debit"
                    />
                    <FormControlLabel
                        value="credit"
                        control={<Radio style={styleCustom.radio} />}
                        label="Credit"
                    />
                </RadioGroup>
            </FormControl>
        </div>
    );
}

RadioDebitCredit.propTypes = {};
RadioDebitCredit.defaultProps = {};

export default RadioDebitCredit;
